import Server from "./Server";
import LogoSecondary from "../assets/LogoSecondary"

function ServerList() {
    return (
      <div className="ServerList">
        <header className="headerSize">
          <img src={LogoSecondary} alt="Logo"/>

        </header>
          <Server></Server>
      </div>
    );
  }

  export default ServerList;
